"16237":{"id":"16237","name":"Os Jovens Titãs: Missão Tóquio","slug":"os-jovens-titas-missao-toquio","original_title":"Teen Titans: Trouble in Tokyo","overview":"Tudo começa quando um vilão ninja ataca a cidade e os titãs tentam impedir. Ao fim da luta, os titãs descobrem que o vilão, Saicotech, fora mandado por Brushogum. A equipe dirige-se a Toquio para investigar as razões de Saicotech der sido enviado e, então, prendê-lo.","first_air_date":"2006-09-15","runtime":75,"episode_run_time":[75],"vote_average":7.8,"created_by":["DC","Warner Bros. Animation"],"production_companies":[{"name":"DC"},{"name":"Warner Bros. Animation"}],"cast":["Greg Cipes","Scott Menville","Khary Payton","Tara Strong","Hynden Walch"],"backdrop_path":"https://image.tmdb.org/t/p/original/fey7NzJ61KAAVPfUgcpaahW5gZ5.jpg","poster_path":"https://image.tmdb.org/t/p/original/oGBqTcA3sTLbcUy4s07RIYcGy2J.jpg","certification":"N/A","genres":["Animação","Ação","Ficção científica","Cinema TV"],"trailer":"N/A"},
