"420821":{"id":"420821","name":"Tico e Teco: Defensores da Lei","slug":"tico-e-teco-defensores-da-lei","original_title":"Chip 'n Dale: Rescue Rangers","overview":"Tico e Teco vivem entre desenhos animados e humanos em Los Angeles nos dias de hoje, mas agora suas vidas são bem diferentes. Já se passaram décadas desde que a série de sucesso da dupla foi cancelada, e Tico se rendeu a uma vida doméstica suburbana como um vendedor de seguros. Enquanto isso, Teco passou por uma harmonização facial em CGI e trabalha no circuito de convenções nostálgicas, desesperado para reviver seus dias de glória. Quando um ex-colega de elenco desaparece misteriosamente, Tico e Teco devem consertar a amizade rompida e assumir mais uma vez suas personalidades de Defensores da Lei para salvar a vida do amigo.","first_air_date":"2022-05-20","runtime":96,"episode_run_time":[96],"vote_average":7.0,"created_by":["Walt Disney Pictures","Mandeville Films"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Mandeville Films"}],"cast":["Andy Samberg","John Mulaney","KiKi Layne","Will Arnett","Eric Bana"],"backdrop_path":"https://image.tmdb.org/t/p/original/qK7Ssnrfvrt65F66A1thvehfQg2.jpg","poster_path":"https://image.tmdb.org/t/p/original/bOYRRVe9jhlwU8hAZ53Kg0vhIH4.jpg","certification":"L","genres":["Animação","Família","Comédia","Aventura","Mistério"],"trailer":"oYyjB7eROPg"},
"16366":{"id":"16366","name":"José: O Rei dos Sonhos","slug":"jose-o-rei-dos-sonhos","original_title":"Joseph: King of Dreams","overview":"Um dia, José tem um sonho premonitório: ele acredita que, de alguma forma, ele será rei e líder de todo um povo. Isso aumenta ainda mais a inveja de seus irmãos, que o traem e o vendem como escravo.José é levado para o Egito, onde sua vida se transforma num verdadeiro martírio. Até o momento em que ele passa a auxiliar o próprio Faraó, na difícil arte da interpretação de sonhos.","first_air_date":"2002-12-04","runtime":74,"episode_run_time":[74],"vote_average":6.8,"created_by":["Universal Home Video","DreamWorks Animation"],"production_companies":[{"name":"Universal Home Video"},{"name":"DreamWorks Animation"}],"cast":["Ben Affleck","Mark Hamill","Richard Herd","Maureen McGovern","Jodi Benson"],"backdrop_path":"https://image.tmdb.org/t/p/original/yjnZisRLrQ39SXY83lSfpysZ4Oo.jpg","poster_path":"https://image.tmdb.org/t/p/original/4PEFpm3YmZu03XLszBQvlbl9eVB.jpg","certification":"N/A","genres":["Família","Animação"],"trailer":"N/A"},
