"149870":{"id":"149870","name":"Vidas ao Vento","slug":"vidas-ao-vento","original_title":"風立ちぬ","overview":"Jiro Horikoshi sonha em voar e projetar belos aviões, inspirado no famoso designer aeronáutico italiano Caproni. Míope desde criança e, portanto, incapaz de voar, Jiro ingressou na divisão aeronáutica de uma empresa de engenharia em 1927. Seu gênio logo é reconhecido e ele se torna um dos mais prestigiados projetistas aeronáuticos. O filme conta sua biografia e recria acontecimentos históricos que marcaram sua vida, como o terremoto de Kanto em 1923, a Grande Depressão, a epidemia de tuberculose e a entrada do Japão na guerra.","first_air_date":"2013-07-20","runtime":126,"episode_run_time":[126],"vote_average":7.8,"created_by":["Studio Ghibli","Nippon Television Network Corporation","dentsu","Hakuhodo DY Media Partners","The Walt Disney Company (Japan)","d-rights","TOHO"],"production_companies":[{"name":"Studio Ghibli"},{"name":"Nippon Television Network Corporation"},{"name":"dentsu"},{"name":"Hakuhodo DY Media Partners"},{"name":"The Walt Disney Company (Japan)"},{"name":"d-rights"},{"name":"TOHO"}],"cast":["Hideaki Anno","Hidetoshi Nishijima","瀧本美織","西村雅彥","Stephen Alpert"],"backdrop_path":"https://image.tmdb.org/t/p/original/zZiflZpuaZerugtfdyXcg6dcylD.jpg","poster_path":"https://image.tmdb.org/t/p/original/uohDiUTPsGGkX4Sb9ZcVGwafEyH.jpg","certification":"12","genres":["Drama","Animação","Romance","Guerra","História"],"trailer":"N/A"},
