"378236":{"id":"378236","name":"Emoji: O Filme","slug":"emoji-o-filme","original_title":"The Emoji Movie","overview":"Textopolis é a cidade onde os Emojis favoritos dos usuários de smartphones vivem e trabalham. Lá, todos eles vivem em função de um sonho: serem usados nos textos dos humanos. Todos estão acostumados a ter somente uma expressão facial - com exceção de Gene, que nasceu com um bug em seu sistema, que o permite trocar de rosto através de um filtro especial. Determinado à se tornar um emoji normal como todos os outros, eles vai encarar uma jornada fantásticas através dos aplicativos de celular mais populares desta geração - e no meio do caminho, claro, fazer novos amigos.","first_air_date":"2017-07-23","runtime":86,"episode_run_time":[86],"vote_average":5.4,"created_by":["Columbia Pictures","Sony Pictures Animation","LStar Capital"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Sony Pictures Animation"},{"name":"LStar Capital"}],"cast":["T.J. Miller","James Corden","Anna Faris","Maya Rudolph","Steven Wright"],"backdrop_path":"https://image.tmdb.org/t/p/original/kTrgxhRSj2sun89bDbnGCPBiey6.jpg","poster_path":"https://image.tmdb.org/t/p/original/g4LW0JOeHyOFRsN6PAyWrH4qbG.jpg","certification":"L","genres":["Animação","Família","Comédia"],"trailer":"meaq8aY0B5k"},
