"9473":{"id":"9473","name":"South Park: Maior, Melhor e Sem Cortes","slug":"south-park-maior-melhor-e-sem-cortes","original_title":"South Park: Bigger, Longer & Uncut","overview":"Fama, autoridade, música, militarismo, raça, sexo e religião, esses são alguns dos ingredientes usados pelos criadores de South Park, nesse longa metragem que mergulha os Estados Unidos numa guerra com o Canadá. Tudo começa quando um grupo de estudantes de South Park, conseguem assistir um filme canadense proibido para menores. Os pais das crianças ficam chocados com o efeito que o filme causa na mente de seus inocentes filhos e exigem que uma pequena cidade serrana, no Colorado, os ouça. Talvez você possa se ofender, ou quem sabe esse filme possa fazer você rir mais do que qualquer outra comédia recente.","first_air_date":"1999-06-30","runtime":81,"episode_run_time":[81],"vote_average":7.3,"created_by":["Paramount Pictures","Warner Bros. Pictures","Comedy Central","Scott Rudin Productions","Parker-Stone Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Warner Bros. Pictures"},{"name":"Comedy Central"},{"name":"Scott Rudin Productions"},{"name":"Parker-Stone Productions"}],"cast":["Trey Parker","Matt Stone","Mary Kay Bergman","Isaac Hayes","Jesse Brant Howell"],"backdrop_path":"https://image.tmdb.org/t/p/original/2q3B90h2hZ6xJTvna9CIFDNaIr4.jpg","poster_path":"https://image.tmdb.org/t/p/original/16ECNyTfEOfE49gFdrutZfGFd9x.jpg","certification":"14","genres":["Animação","Comédia"],"trailer":"N/A"},
