"82703":{"id":"82703","name":"As Aventuras de Peabody e Sherman","slug":"as-aventuras-de-peabody-e-sherman","original_title":"Mr. Peabody & Sherman","overview":"Sr. Peabody é um magnata de negócios, inventor, cientista, ganhador do prêmio Nobel, chef, duas vezes medalhista olímpico e gênio... Que também é um cachorro. Usando a sua engenhosa invenção, a máquina WABAC, o Sr. Peabody e seu filho adotivo, Sherman, viajam no tempo para vivenciar eventos que mudaram o mundo em primeira mão e interagir com as maiores personalidades da história. Mas quando Sherman quebra as regras da viagem no tempo, nossos dois heróis entrarão em uma corrida para reparar a história e salvar o futuro, enquanto Sr. Peabody enfrenta o maior desafio de sua vida - ser pai.","first_air_date":"2014-02-07","runtime":92,"episode_run_time":[92],"vote_average":6.7,"created_by":["Pacific Data Images","DreamWorks Animation","Bullwinkle Studios"],"production_companies":[{"name":"Pacific Data Images"},{"name":"DreamWorks Animation"},{"name":"Bullwinkle Studios"}],"cast":["Ty Burrell","Max Charles","Ariel Winter","Allison Janney","Stephen Colbert"],"backdrop_path":"https://image.tmdb.org/t/p/original/lt9F9yYNccC23JwviYOi9U644DZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/ndGl3yPRbHlem0PuDJuUvUuY9dQ.jpg","certification":"L","genres":["Animação","Aventura","Família"],"trailer":"eNYyDdq3ZMg"},
