"11621":{"id":"11621","name":"Porco Rosso: O Último Herói Romântico","slug":"porco-rosso-o-ultimo-heroi-romantico","original_title":"紅の豚","overview":"Na Itália, durante o período entre as duas guerras, com um fundo de recessão económica e de ascensão do fascismo, perdido numa ilha deserta no mar Adriático, um ex-piloto emérito da Força Aérea Italiana, se vê transformado em um porco e converte-se em caçador de recompensas. Ele se chama \"Porco Rosso\". A bordo de seu hidroavião vermelho, ele tem muitas aventuras: de caça aos piratas do ar que fizeram um hábito de roubar os turistas que visitam a região, o resgate de passageiros tomados como reféns, duelos aéreos, \"corridas\" de hidroavião, subterfúgios para semear a polícia secreta italiana... a vida do piloto é agitada e cheia de aventuras.","first_air_date":"1992-07-18","runtime":93,"episode_run_time":[93],"vote_average":7.8,"created_by":["Studio Ghibli","Nibariki","Mitsubishi","Nippon Television Network Corporation","Tokuma Shoten"],"production_companies":[{"name":"Studio Ghibli"},{"name":"Nibariki"},{"name":"Mitsubishi"},{"name":"Nippon Television Network Corporation"},{"name":"Tokuma Shoten"}],"cast":["森山周一郎","加藤登紀子","Bunshi Katsura Vi","Tsunehiko Kamijô","Akemi Okamura"],"backdrop_path":"https://image.tmdb.org/t/p/original/pFalq14lacs2oO7Q6YKiNqz5uAC.jpg","poster_path":"https://image.tmdb.org/t/p/original/ts1oKmmSr2tM9qmzDUNzMWs9EDq.jpg","certification":"L","genres":["Família","Comédia","Animação","Aventura"],"trailer":"N/A"},
