"15167":{"id":"15167","name":"Barbie: O Quebra-Nozes","slug":"barbie-o-quebra-nozes","original_title":"Barbie in the Nutcracker","overview":"Como que por magia, Barbie ganha vida nesta prodigiosa adaptação do conto clássico de Hoffman, animado por computador. A história inicia-se quando Clara recebe um belo Quebra-Nozes de madeira como presente de sua tia favorita. Nessa noite, o Quebra-Nozes ganha vida para expulsar o Rei dos Ratos, que invadiu os aposentos de Clara. Ela acorda e ajuda o Quebra-Nozes, mas o Rei dos Ratos, através de um feitiço maléfico, a faz diminuir de tamanho. Clara e o Quebra-Nozes partem numa aventura fantástica para encontrar a Fada Açucarada, a única pessoa com poderes para quebrar o maléfico feitiço.","first_air_date":"2001-09-30","runtime":76,"episode_run_time":[76],"vote_average":6.9,"created_by":["Mattel","Mainframe Entertainment"],"production_companies":[{"name":"Mattel"},{"name":"Mainframe Entertainment"}],"cast":["Kelly Sheridan","Kirby Morrow","Tim Curry","Peter Kelamis","Christopher Gaze"],"backdrop_path":"https://image.tmdb.org/t/p/original/budvUJdSNKVzEkNdoh4qa4r7Vj1.jpg","poster_path":"https://image.tmdb.org/t/p/original/dm7IBahbPkjbc5FOD6pW0mjYVAA.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
"81":{"id":"81","name":"Nausicaä do Vale do Vento","slug":"nausicaa-do-vale-do-vento","original_title":"風の谷のナウシカ","overview":"Após os Sete Dias de Fogo, uma guerra que destruiu a civilização humana e a maior parte do ecossistema da Terra, surge uma floresta que exala gases venenosos. Apenas insetos e seres conhecidos como Ohms vivem por lá. Nausicaä, filha do rei do Vale do Vento, tem o estranho poder de conseguir sentir o que a floresta sente e se vê obrigada a sair em uma jornada para tentar evitar outra guerra devastadora.","first_air_date":"1984-03-11","runtime":117,"episode_run_time":[117],"vote_average":8.0,"created_by":["Topcraft"],"production_companies":[{"name":"Topcraft"}],"cast":["島本須美","永井一郎","納谷悟朗","松田洋治","榊原良子"],"backdrop_path":"https://image.tmdb.org/t/p/original/ulVUa2MvnJAjAeRt7h23FFJVRKH.jpg","poster_path":"https://image.tmdb.org/t/p/original/UkCcG94fX1fKIu6DWzwEfpbxL9.jpg","certification":"N/A","genres":["Aventura","Animação","Fantasia"],"trailer":"N/A"},
