"533":{"id":"533","name":"Wallace & Gromit: A Batalha dos Vegetais","slug":"wallace-gromit-a-batalha-dos-vegetais","original_title":"Wallace & Gromit: The Curse of the Were-Rabbit","overview":"O bairro onde moram o pacato inventor Wallace (Peter Sallis) e seu fiel cão Gromit está em polvorosa com a proximidade do concurso anual de legumes gigantes, organizado pela bela e solteira Lady Tottington (Helena Bonham Carter). Para proteger as plantações de coelhos famintos, Wallace inventa um equipamento que captura os animais sem machucá-los. O problema é o que fazer com o excesso de coelhos, que não demoram a superpovoar a casa do inventor. A dupla tem ainda de lidar com uma misteriosa fera vegetariana, que está destruindo as plantações à noite. Agora a honra de Wallace está em jogo, pois ele precisa capturá-la antes do arrogante Victor Quartermaine (Ralph Fiennes), que está de olho na fortuna de Lady Tottington.","first_air_date":"2005-09-15","runtime":81,"episode_run_time":[81],"vote_average":7.1,"created_by":["Aardman","DreamWorks Animation"],"production_companies":[{"name":"Aardman"},{"name":"DreamWorks Animation"}],"cast":["Peter Sallis","Ralph Fiennes","Helena Bonham Carter","Peter Kay","Nicholas Smith"],"backdrop_path":"https://image.tmdb.org/t/p/original/3XR0OjxvxbJt2vIfBROBa8dDkou.jpg","poster_path":"https://image.tmdb.org/t/p/original/o06EMgTpbObtQabzKCHwU1QS0Y6.jpg","certification":"L","genres":["Aventura","Animação","Comédia","Família"],"trailer":"N/A"},
"176983":{"id":"176983","name":"One Piece: Z","slug":"one-piece-z","original_title":"ワンピース フィルム ゼット","overview":"Comparável às Armas Antigas, o trunfo dos fuzileiros navais, as “Pedras Dyna”, de repente foram roubadas por um homem terrivelmente poderoso, o ex- Almirante “Z”! Após uma curta e devastadora batalha contra o almirante Kizaru, “Z” fica gravemente ferido e é encontrado no mar pelo bando dos Chapéus de Palha, porém decide acabar com eles após saber que são piratas. A sede da Marinha finalmente se move para lidar com a conspiração que ameaça abalar os pilares do Novo Mundo.","first_air_date":"2012-12-15","runtime":108,"episode_run_time":[108],"vote_average":7.5,"created_by":["Toei Animation","Yasahi-Mation Productions","Toei Company"],"production_companies":[{"name":"Toei Animation"},{"name":"Yasahi-Mation Productions"},{"name":"Toei Company"}],"cast":["Mayumi Tanaka","Kazuya Nakai","Akemi Okamura","Kappei Yamaguchi","Hiroaki Hirata"],"backdrop_path":"https://image.tmdb.org/t/p/original/ut1HSUkIFJqXUpRsfEyqYNnfXOu.jpg","poster_path":"https://image.tmdb.org/t/p/original/guzIZgMMUp11qDA22clAdVXRids.jpg","certification":"N/A","genres":["Animação","Fantasia","Ação","Aventura"],"trailer":"N/A"},
