"2310":{"id":"2310","name":"A Lenda de Beowulf","slug":"a-lenda-de-beowulf","original_title":"Beowulf","overview":"Em uma época de heróis, um cavaleiro chamado Beowulf chega à corte do Rei Hrothgar e oferece para combater um demônio chamado Grendel. Ele combate a fera com sucesso, mas terá que enfrentar também a ira da mãe de Grendel, uma criatura má e vingativa, porém sedutora.","first_air_date":"2007-11-05","runtime":115,"episode_run_time":[115],"vote_average":5.9,"created_by":["Shangri-La Entertainment","ImageMovers","Warner Bros. Pictures","Paramount Pictures"],"production_companies":[{"name":"Shangri-La Entertainment"},{"name":"ImageMovers"},{"name":"Warner Bros. Pictures"},{"name":"Paramount Pictures"}],"cast":["Ray Winstone","Angelina Jolie","Anthony Hopkins","John Malkovich","Robin Wright"],"backdrop_path":"https://image.tmdb.org/t/p/original/lIruQxRCxw5ZI3CmBL6VxwpKtUe.jpg","poster_path":"https://image.tmdb.org/t/p/original/oVjkoLfiR8fScXQAS7nMiu6RxH.jpg","certification":"14","genres":["Aventura","Ação","Animação"],"trailer":"N/A"},
"1034062":{"id":"1034062","name":"Mortal Kombat Legends: Cage Bom de Luta","slug":"mortal-kombat-legends-cage-bom-de-luta","original_title":"Mortal Kombat Legends: Cage Match","overview":"Na Hollywood dos anos 1980, o astro de ação Johnny Cage está procurando se tornar um ator do primeiro escalão. Mas, quando sua companheira, Jennifer, desaparece do set, ele se vê jogado em um mundo cheio de sombras e perigo. Ao embarcar em uma jornada sangrenta, Johnny rapidamente descobre que a Cidade dos Anjos tem mais do que alguns demônios em seu meio. Ele enfrenta uma sinistra sociedade secreta tramando um esquema nefasto, mas a luta brutal contra os guerreiros sanguinários de Netherrealm está apenas começando.","first_air_date":"2023-10-17","runtime":76,"episode_run_time":[76],"vote_average":6.7,"created_by":["Warner Bros. Animation"],"production_companies":[{"name":"Warner Bros. Animation"}],"cast":["Joel McHale","Jennifer Grey","Dusan Brown","Grey DeLisle","Robin Atkin Downes"],"backdrop_path":"https://image.tmdb.org/t/p/original/p0IejE15lzXBGhRTpKoHPsSrHf7.jpg","poster_path":"https://image.tmdb.org/t/p/original/hEl5fUsMadGoDesI2dFGMXqJPmb.jpg","certification":"18","genres":["Animação","Ação","Fantasia","Aventura"],"trailer":"r3Yh4EJpQls"},
"151960":{"id":"151960","name":"Aviões","slug":"avioes","original_title":"Planes","overview":"Dusty não foi propriamente feito para participar em corridas aéreas e ainda por cima tem medo de alturas. Por isso, recorre a Skipper, um aviador naval, que ajuda Dusty a qualificar-se para competir com Ripslinger, o detentor do título de campeão do circuito de corridas. A coragem de Dusty é posta à prova quando ousa alcançar alturas que nunca imaginara possíveis, inspirando-o a voar mais alto.","first_air_date":"2013-08-09","runtime":91,"episode_run_time":[91],"vote_average":5.9,"created_by":["Walt Disney Pictures","DisneyToon Studios"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"DisneyToon Studios"}],"cast":["Dane Cook","Carlos Alazraqui","Val Kilmer","Julia Louis-Dreyfus","Brad Garrett"],"backdrop_path":"https://image.tmdb.org/t/p/original/1BaUaXBRKzwNESZ6hZkZjelatmt.jpg","poster_path":"https://image.tmdb.org/t/p/original/4KrnsveRY7O6YR2X0j1vGrEksIZ.jpg","certification":"L","genres":["Animação","Família","Aventura","Comédia"],"trailer":"N/A"},
"431580":{"id":"431580","name":"Abominável","slug":"abominavel","original_title":"Abominable","overview":"Shanghai, China. Yi é uma adolescente que, certo dia, descobre que um yeti está no telhado do prédio em que ela mora. A partir disso, ela e seus colegas passam a chamar a criatura mística de \"Everest\" e, ao criarem laços com o animal, decidem levá-lo até sua família, que está no topo do planeta. Porém, os três amigos terão que conseguir despistar o ganancioso Burnish e a zoóloga Dra. Zara, que querem pegar o yeti a qualquer custo.","first_air_date":"2019-09-19","runtime":92,"episode_run_time":[92],"vote_average":7.5,"created_by":["DreamWorks Animation","dentsu","Pearl Studio","Zhong Ming You Ying Film","Universal Pictures"],"production_companies":[{"name":"DreamWorks Animation"},{"name":"dentsu"},{"name":"Pearl Studio"},{"name":"Zhong Ming You Ying Film"},{"name":"Universal Pictures"}],"cast":["Chloe Bennet","Albert Tsai","Eddie Izzard","Tenzing Norgay Trainor","Joseph Izzo"],"backdrop_path":"https://image.tmdb.org/t/p/original/tLCDKsXo6D84IVFanoElosSEKdp.jpg","poster_path":"https://image.tmdb.org/t/p/original/oC89hsRFoF4OcrgYIKysDD7M6XO.jpg","certification":"L","genres":["Família","Animação","Aventura","Comédia"],"trailer":"TzPMGyCQOuA"},
