"7484":{"id":"7484","name":"O Bicho Vai Pegar","slug":"o-bicho-vai-pegar","original_title":"Open Season","overview":"Boog (Martin Lawrence) é um urso pardo domesticado, que vive na pacata cidade de Timberline. Ele é a grande estrela dos shows ecológicos de sua cidade, sendo que à noite desfruta das acomodações da garagem de Beth (Debra Messing), uma guarda florestal que o criou desde que era filhote. Porém nem todos gostam de Boog. Shaw (Gary Sinise) é um deles, pois acredita que os animais estão conspirando contra os humanos. Em uma de suas caçadas ele traz à cidade Elliot (Ashton Kutcher), um cervo de um único chifre que ainda está vivo. Após vários pedidos, Boog decide ajudá-lo e solta Elliot. Querendo retribuir o favor, Elliot segue Boog até sua casa e decide libertá-lo de sua garagem, a qual considera como sendo seu cativeiro.","first_air_date":"2006-09-27","runtime":83,"episode_run_time":[83],"vote_average":6.2,"created_by":["Sony Pictures Animation","Columbia Pictures"],"production_companies":[{"name":"Sony Pictures Animation"},{"name":"Columbia Pictures"}],"cast":["Martin Lawrence","Ashton Kutcher","Gary Sinise","Debra Messing","Billy Connolly"],"backdrop_path":"https://image.tmdb.org/t/p/original/wttDKH1WRXGpebDVzrqnVSdh15u.jpg","poster_path":"https://image.tmdb.org/t/p/original/t6n81JDmbKnjjdagHmPx3gSGVNr.jpg","certification":"L","genres":["Animação","Família","Aventura","Comédia"],"trailer":"N/A"},
