"39103":{"id":"39103","name":"Dragon Ball Z: O Retorno de Cooler","slug":"dragon-ball-z-o-retorno-de-cooler","original_title":"ドラゴンボールZ 激突!!100億パワーの戦士たち","overview":"Todos pensavam que Cooler, o terrível irmão de Freeza, havia sido vencido por Goku. Porém, ele está de volta e muito mais poderoso. Cooler vai ao planeta Novo Namekusei, a terra natal de Piccolo, e começa a escravizar todos usando seu exército de robôs. Os Guerreiros Z ficam sabendo destes acontecimentos e assim, Goku, Gohan, Kuririn, Piccolo, Mestre Kame, Yajirobe e Oolong, partem para lá para ajudar seus amigos. Mas, o que os heróis não esperavam era que Cooler havia ficado muito mais forte. O vilão, agora usando um tipo de armadura metálica, é chamado de Metal Cooler e está decidido a se vingar de Goku.","first_air_date":"1992-03-07","runtime":45,"episode_run_time":[45],"vote_average":6.4,"created_by":["Toei Company","Bird Studios","Toei Animation"],"production_companies":[{"name":"Toei Company"},{"name":"Bird Studios"},{"name":"Toei Animation"}],"cast":["Masako Nozawa","古川登志夫","Mayumi Tanaka","Ryo Horikawa","宮内幸平"],"backdrop_path":"https://image.tmdb.org/t/p/original/l1H7adqYhxBrBK45aKAzqm6nIVC.jpg","poster_path":"https://image.tmdb.org/t/p/original/lvlHl1IFBdBfnLA4sgyjdqeyIEU.jpg","certification":"N/A","genres":["Ação","Animação","Ficção científica"],"trailer":"N/A"},
