"51739":{"id":"51739","name":"O Mundo dos Pequeninos","slug":"o-mundo-dos-pequeninos","original_title":"借りぐらしのアリエッティ","overview":"Nos subúrbios de Tóquio, sob o assoalho de uma casa velha, Arrietty vive em seu minúsculo mundo com a família, fazendo de tudo para manter em segredo a existência de todos. Sobrevivendo como pequenos ladrões, eles conhecem as regras para que nunca sejam percebidos pelos verdadeiros (e grandes) donos da casa. Para isso, procuram manter a desconfiança deles em cima dos gatos e ratos e tomam todos os cuidados possíveis para evitar de serem vistos. Contudo, quando um jovem rapaz se hospeda na casa, a pequenina Arietty acredita que poderá manter uma amizade com ele, apesar da diferença dos tamanhos.","first_air_date":"2010-07-16","runtime":94,"episode_run_time":[94],"vote_average":7.7,"created_by":["Studio Ghibli","Hakuhodo DY Media Partners","Mitsubishi Shoji","dentsu","TOHO","Nippon Television Network Corporation","Wild Bunch","The Walt Disney Company (Japan)"],"production_companies":[{"name":"Studio Ghibli"},{"name":"Hakuhodo DY Media Partners"},{"name":"Mitsubishi Shoji"},{"name":"dentsu"},{"name":"TOHO"},{"name":"Nippon Television Network Corporation"},{"name":"Wild Bunch"},{"name":"The Walt Disney Company (Japan)"}],"cast":["志田未来","Ryunosuke Kamiki","三浦友和","竹下景子","Kirin Kiki"],"backdrop_path":"https://image.tmdb.org/t/p/original/7Z7WVzJsSReG8B0CaPk0bvWD7tK.jpg","poster_path":"https://image.tmdb.org/t/p/original/yovlgDFP53N7IW7O4irM6INBxmp.jpg","certification":"L","genres":["Fantasia","Animação","Família"],"trailer":"taaI61OnHrY"},
