"17979":{"id":"17979","name":"Os Fantasmas de Scrooge","slug":"os-fantasmas-de-scrooge","original_title":"A Christmas Carol","overview":"O Natal se aproxima e, como sempre, Ebenezer Scrooge (Jim Carrey) mantém seu desprezo pela data. Milionário e muito mesquinho, ele só pensa em dinheiro e não dá espaço para a emoção em seu coração, maltratando Bob Cratchit (Gary Oldman), seu fiel assistente, e ignorando seu sobrinho Fred (Colin Firth). Com a morte de seu sócio, Ebenezer recebe a visita de três fantasmas do Natal: do passado, do presente e do futuro. Cada um deles, levará o velho ranzinza para uma viagem que o ajudará a refletir melhor sobre sua vida passada e a escolha que fará para o futuro.","first_air_date":"2009-11-04","runtime":96,"episode_run_time":[96],"vote_average":6.9,"created_by":["Walt Disney Pictures","ImageMovers Digital"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"ImageMovers Digital"}],"cast":["Jim Carrey","Gary Oldman","Colin Firth","Robin Wright","Cary Elwes"],"backdrop_path":"https://image.tmdb.org/t/p/original/bFntIQxWBwtzYAFc68xF1GKAfiv.jpg","poster_path":"https://image.tmdb.org/t/p/original/1qhU3VJo10sISkHIyANLsHioq0Y.jpg","certification":"L","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
"18861":{"id":"18861","name":"Naruto: Guardiões do Reino da Lua Crescente","slug":"naruto-guardioes-do-reino-da-lua-crescente","original_title":"劇場版 NARUTO -ナルト- 大興奮!みかづき島のアニマル騒動だってばよ","overview":"Naruto Uzumaki, Sakura Haruno, Rock Lee e Kakashi Hatake foram enviados para proteger um príncipe durante sua viagem ao redor do mundo e garantir que ele volte com segurança para sua casa no País da Lua. O País da Lua por ser muito rico possibilita que o Príncipe compre tudo que deseja. Durante sua viagem, o Príncipe encontra um grupo circense que possui um raro tigre dente-de-sabre que ele deseja ter, então ele compra o grupo todo. De repente a missão de proteger o príncipe que difícilmente escuta o que lhe é dito, se torna em uma missão para proteger não só ele, mas também outros animais, e tentar levá-los de alguma forma salvos para suas casas. O problema surge quando três ninjas que manipulam jutsus amedrontadores estão a espera deles.","first_air_date":"2006-08-05","runtime":95,"episode_run_time":[95],"vote_average":7.0,"created_by":["Pierrot"],"production_companies":[{"name":"Pierrot"}],"cast":["竹内順子","中村千絵","増川洋一","Kazuhiko Inoue","大塚明夫"],"backdrop_path":"https://image.tmdb.org/t/p/original/j2oX7UeZJJD6tUczrVECcJCdLaG.jpg","poster_path":"https://image.tmdb.org/t/p/original/2wwVFqDULo63dxQGp4jOKzClIGt.jpg","certification":"N/A","genres":["Aventura","Animação","Ação"],"trailer":"N/A"},
