"400157":{"id":"400157","name":"O Parque dos Sonhos","slug":"o-parque-dos-sonhos","original_title":"Wonder Park","overview":"A jovem otimista e sonhadora June encontra escondido na floresta um parque de diversões chamado Wonderland, que é cheio de passeios e animais que falam. O único problema é que o parque está confuso e desorganizado. June logo descobre que o parque veio de sua imaginação e que ela é a única que pode deixar o lugar mágico de novo.","first_air_date":"2019-03-13","runtime":86,"episode_run_time":[86],"vote_average":6.5,"created_by":["Nickelodeon Movies","Paramount Animation","Ilion Animation Studios","Paramount Pictures"],"production_companies":[{"name":"Nickelodeon Movies"},{"name":"Paramount Animation"},{"name":"Ilion Animation Studios"},{"name":"Paramount Pictures"}],"cast":["Brianna Denski","Norbert Leo Butz","Ken Hudson Campbell","Mila Kunis","John Oliver"],"backdrop_path":"https://image.tmdb.org/t/p/original/h5Vxa8BRTeuY2MEu6lnJjv6p2Zr.jpg","poster_path":"https://image.tmdb.org/t/p/original/sxybUNiRTGSCkOOWtOf3kDse43v.jpg","certification":"L","genres":["Comédia","Animação","Aventura","Família","Fantasia"],"trailer":"SNy8kjbmJxQ"},
