"77887":{"id":"77887","name":"Toy Story Toons: Férias no Havaí","slug":"toy-story-toons-ferias-no-havai","original_title":"Hawaiian Vacation","overview":"É tempo de férias para Bonnie, que está indo para o Havaí com sua família. Os brinquedos estão animados para uma semana de folga, mas Barbie e Ken entram na mochila de Bonnie, na esperança de ir com ela para o Havaí. Porém, Bonnie deixa sua mochila em casa, para horror de Ken. Barbie revela a Woody que Ken tinha planejado lhe dar o primeiro beijo na praia ao pôr do sol. Woody, Buzz e os outros brinquedos recriam o Havaí para os dois.","first_air_date":"2011-06-16","runtime":6,"episode_run_time":[6],"vote_average":7.0,"created_by":["Pixar"],"production_companies":[{"name":"Pixar"}],"cast":["Tom Hanks","Tim Allen","Joan Cusack","Don Rickles","Estelle Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/Tvn4W6qdbqhW5qcL7FZgb6570b.jpg","poster_path":"https://image.tmdb.org/t/p/original/kKpwfOZ0IhyDXjQ3KTQlmbznD16.jpg","certification":"N/A","genres":["Animação","Família","Comédia"],"trailer":"N/A"},
