"77931":{"id":"77931","name":"Os Smurfs 2","slug":"os-smurfs-2","original_title":"The Smurfs 2","overview":"Gargamel (Hank Azaria) cria os Naughties Vexy (voz de Christina Ricci) e Hackus (J.B. Smoove) com a esperança de conseguir a essência dos Smurfs. Só um Smurf pode dar o que o feiticeiro quer, porém, e Smurfette conhece uma fórmula capaz de transformar um Naughty em um Smurf azul de verdade. Gargamel então rapta Smurfette e a leva a Paris onde ele é adorado por milhões como o maior mago do mundo e cabe aos outros Smurfs salvar sua companheira.","first_air_date":"2013-07-30","runtime":102,"episode_run_time":[102],"vote_average":5.7,"created_by":["NeoReel","Columbia Pictures","Sony Pictures Animation","Hemisphere Media Capital","Kerner Entertainment Company"],"production_companies":[{"name":"NeoReel"},{"name":"Columbia Pictures"},{"name":"Sony Pictures Animation"},{"name":"Hemisphere Media Capital"},{"name":"Kerner Entertainment Company"}],"cast":["Hank Azaria","Neil Patrick Harris","Jayma Mays","Brendan Gleeson","Katy Perry"],"backdrop_path":"https://image.tmdb.org/t/p/original/6tPNO3fPfZUHXU5H7oSUg34xoXY.jpg","poster_path":"https://image.tmdb.org/t/p/original/52p2PtBAebB0HwvfY5YIowT7sFI.jpg","certification":"L","genres":["Fantasia","Família","Comédia","Animação"],"trailer":"3zUwxkBczXI"},
