"297556":{"id":"297556","name":"Liga da Justiça: Trono de Atlantis","slug":"liga-da-justica-trono-de-atlantis","original_title":"Justice League: Throne of Atlantis","overview":"Após os eventos de \"Liga da Justiça: Guerra”, o Mestre do Oceano e o Arraia Negra declararam guerra contra a superfície em retaliação aos testes com armas realizados pela marinha após a invasão planetária do Senhor de Apokolips, Darkseid. Enquanto isso, a Rainha Atlanna busca pelo seu outro filho, meio-irmão do Mestre do oceano, Arthur Curry, um meio-humano com poderes aquáticos, mas sem o conhecimento de sua linhagem. Mesmo que ele viva com poderes além de sua compreensão, ele percebe os perigos que o cercam e se junta à Liga da Justiça, e junto aos seus novos companheiros ele deve abraçar o seu destino e lutar contra a destruição da Terra.","first_air_date":"2015-01-13","runtime":72,"episode_run_time":[72],"vote_average":7.0,"created_by":["DC Entertainment","Warner Bros. Animation"],"production_companies":[{"name":"DC Entertainment"},{"name":"Warner Bros. Animation"}],"cast":["Sean Astin","Rosario Dawson","Nathan Fillion","Christopher Gorham","Matt Lanter"],"backdrop_path":"https://image.tmdb.org/t/p/original/ltlPFTMRsohmi2QbbSZUkAVg7Nc.jpg","poster_path":"https://image.tmdb.org/t/p/original/t6hcyzdgpGBVlEzizCmg5CWY8Fv.jpg","certification":"12","genres":["Ficção científica","Ação","Animação","Aventura"],"trailer":"N/A"},
