"16198":{"id":"16198","name":"Meus Vizinhos, Os Yamadas","slug":"meus-vizinhos-os-yamadas","original_title":"ホーホケキョ となりの山田くん","overview":"O filme mostra o dia a dia da família Yamada, que é composta por Takashi (o pai, um trabalhador comum), Matsuko (a mãe, dona de casa), Shige (a sogra), Noboru (o filho adolescente), Nonoko (a filha criança) e Pochi (o cachorro da família). A história é dividida em quadros curtos, cada um focando algum ponto interessante do cotidiano da família, mais ou menos como se vê nas tirinhas de jornal. Trata de problemas que vemos em nossos próprios lares, como a exigência dos pais para que o filho adolescente estude mais, a mãe que não quer ser tratada como uma empregada, o pai que chega cansado demais do trabalho e tem de acordar cedo para uma reunião de negócios, o adolescente passando por crises existenciais, os pensamentos inocentes da criança... Essas coisas que conhecemos muito bem...","first_air_date":"1999-07-17","runtime":104,"episode_run_time":[104],"vote_average":7.0,"created_by":["Studio Ghibli","Tokuma Shoten","Nippon Television Network Corporation","Hakuhodo","Buena Vista Home Entertainment"],"production_companies":[{"name":"Studio Ghibli"},{"name":"Tokuma Shoten"},{"name":"Nippon Television Network Corporation"},{"name":"Hakuhodo"},{"name":"Buena Vista Home Entertainment"}],"cast":["Hayato Isohata","荒木雅子","宇野なおみ","益岡徹","朝丘雪路"],"backdrop_path":"https://image.tmdb.org/t/p/original/gp2Mmcc8h8B6kQ7LwtjDMXTtaxl.jpg","poster_path":"https://image.tmdb.org/t/p/original/1R9OGxxenuxG7QbRPuFOUDdbWcH.jpg","certification":"N/A","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
