"263109":{"id":"263109","name":"Shaun, o Carneiro: O Filme","slug":"shaun-o-carneiro-o-filme","original_title":"Shaun the Sheep Movie","overview":"Shaun é um carneiro que, um belo dia, resolve tirar um dia de folga com os outros animais, para sair da rotina da fazenda. Só que, acidentalmente, ele acaba mandando o carinhoso fazendeiro para a cidade grande, onde o homem perde a memória. Os animais, então, comandados por shaun, vão aprontar altas confusões no caos urbano para trazer o dono de volta para casa.","first_air_date":"2015-02-05","runtime":85,"episode_run_time":[85],"vote_average":7.0,"created_by":["Aardman","Anton Capital Entertainment","StudioCanal"],"production_companies":[{"name":"Aardman"},{"name":"Anton Capital Entertainment"},{"name":"StudioCanal"}],"cast":["Justin Fletcher","John Sparkes","Omid Djalili","Rich Webber","Kate Harbour"],"backdrop_path":"https://image.tmdb.org/t/p/original/sQbpfYoGiEBUnr8tBjHP51heNNT.jpg","poster_path":"https://image.tmdb.org/t/p/original/I7LCUjD6X7ijWwIsIOjgdIMtoF.jpg","certification":"N/A","genres":["Família","Animação","Comédia","Aventura"],"trailer":"eASi5xkj0Dg"},
"408647":{"id":"408647","name":"Jovens Titãs: O Contrato de Judas","slug":"jovens-titas-o-contrato-de-judas","original_title":"Teen Titans: The Judas Contract","overview":"Liderados por Estelar, os Jovens Titãs – Mutano, Ravena, Besouro Azul, Robin e o recém-chegado Asa Norturna – formam um time estrondoso para lutar contra as forças do mal. Porém, a chegada de uma nova integrante, a misteriosa e poderosa Terra pode afetar o equilíbrio desse grupo. Enquanto isso, um ser maligno antigo, Irmão Sangue, acordou e Exterminador, um inimigo familiar está escondendo-se nas sombras, ambos esperando para atacar. Os Jovens Titãs vão enfrentar seus inimigos e precisarão superar conflitos dentro do time nesta aventura intrigante e cheia de reviravoltas.","first_air_date":"2017-03-31","runtime":84,"episode_run_time":[84],"vote_average":7.4,"created_by":["DC Entertainment","Warner Bros. Animation"],"production_companies":[{"name":"DC Entertainment"},{"name":"Warner Bros. Animation"}],"cast":["Stuart Allan","Jake T. Austin","Taissa Farmiga","Christina Ricci","Brandon Soo Hoo"],"backdrop_path":"https://image.tmdb.org/t/p/original/dSRojmK1OMeC7NoR3nuSjQq83mH.jpg","poster_path":"https://image.tmdb.org/t/p/original/iciiTZxbJusZhfeG2bYWhkAqZR0.jpg","certification":"N/A","genres":["Ficção científica","Animação","Ação","Aventura","Crime","Drama","Fantasia"],"trailer":"N/A"},
"553837":{"id":"553837","name":"Code Geass: Lelouch of the Re;surrection","slug":"code-geass-lelouch-of-the-re-surrection","original_title":"コードギアス 復活のルルーシュ","overview":"Desde o fim do homem que acreditavam ser o imperador mais tirano da Britânia um ano atrás, o mundo gozou de uma paz nunca antes vista sob a direção da Federação das Nações Unidas. Entretanto, essa paz frágil é destruída quando militantes armados raptam a antiga princesa Nunnally vi Britania e Kururugi Suzaku, o conselheiro chefe dos Cavaleiros Negros, iniciando uma crise internacional. O poderoso e nada confiável Reino do Zilkhstão é acusado de orquestrar suas capturas. Para investigar, autoridades mundiais enviam Kallen Stadtfeld e seus companheiros numa operação furtiva no país. Lá, eles encontram a imortal C.C., que está numa missão para completar a ressurreição do homem responsável pela maior revolução da história, uma lenda que irá se erguer, tomar comando, e salvar o mundo do perigo outra vez.","first_air_date":"2019-02-09","runtime":112,"episode_run_time":[112],"vote_average":7.3,"created_by":["SUNRISE"],"production_companies":[{"name":"SUNRISE"}],"cast":["Jun Fukuyama","ゆかな","Takahiro Sakurai","Ayumu Murase","Nobunaga Shimazaki"],"backdrop_path":"https://image.tmdb.org/t/p/original/q62ZISQcYEQdiQkGCb20VpPljJO.jpg","poster_path":"https://image.tmdb.org/t/p/original/nhcw4OhNEf1VXgo7x7gF3SlKRts.jpg","certification":"N/A","genres":["Animação","Ficção científica","Crime","Mistério","Guerra"],"trailer":"N/A"},
