"23566":{"id":"23566","name":"Barbie e As Três Mosqueteiras","slug":"barbie-e-as-tres-mosqueteiras","original_title":"Barbie and the Three Musketeers","overview":"A jovem Corinne tem um grande sonho - ser uma mosqueteira! O problema é que esse é um trabalho só para homens. Mas, mesmo assim, Corinne decide ir para Paris e lutar por aquilo que quer. Lá, ela conhece Viveca, Aramina e Reneé, três moças que têm o mesmo objetivo. Juntas, elas vão treinar muito para, um dia, provar seu valor. E essa oportunidade está mais perto do que elas imaginam. O malvado regente Felipe está conspirando contra o príncipe Louis para tomar poder. Agora, para desmascarar esse terrível vilão e salvar a vida de Louis, as quatro corajosas guerreiras vão precisar de todas as suas habilidades. E, quem sabe, ainda provar para o príncipe que são dignas de se juntar aos soldados do reino.","first_air_date":"2009-09-15","runtime":81,"episode_run_time":[81],"vote_average":7.3,"created_by":["Rainmaker Entertainment","Mattel"],"production_companies":[{"name":"Rainmaker Entertainment"},{"name":"Mattel"}],"cast":["Kelly Sheridan","Tim Curry","Kira Tozer","Willow Johnson","Dorla Bell"],"backdrop_path":"https://image.tmdb.org/t/p/original/cBA1XclXfZGtdRRpTLBbjrAYy1S.jpg","poster_path":"https://image.tmdb.org/t/p/original/aulv0DUM41tmEM9BoDVaczBojsz.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
"1234397":{"id":"1234397","name":"Grand Theft Hamlet","slug":"grand-theft-hamlet","original_title":"Grand Theft Hamlet","overview":"Dois amigos desempregados e desesperados por um propósito, têm uma ideia durante a pandemia: encenar o clássico 'Hamlet' de Shakespeare em Grand Theft Auto. Porém, mesmo estando em um mundo virtual, a realidade se intromete, migrando para um filme selvagem e inteiramente filmado dentro de um videogame ultra-violento.","first_air_date":"2024-12-06","runtime":91,"episode_run_time":[91],"vote_average":6.7,"created_by":["Grasp The Nettle Films","Project 1961","Park Pictures Features","Spark Features","Hazel Pictures"],"production_companies":[{"name":"Grasp The Nettle Films"},{"name":"Project 1961"},{"name":"Park Pictures Features"},{"name":"Spark Features"},{"name":"Hazel Pictures"}],"cast":["Sam Crane","Pinny Grylls","Jen Cohn","Tilly Steele","Dipo Ola"],"backdrop_path":"https://image.tmdb.org/t/p/original/8dNdO7c6tie614fvhqJ2RombdKZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/4EapNJPpamivcOKKgivsiTiUTtM.jpg","certification":"N/A","genres":["Animação","Drama","Documentário"],"trailer":"N/A"},
"446894":{"id":"446894","name":"Pé Pequeno","slug":"pe-pequeno","original_title":"Smallfoot","overview":"Um Yeti, criatura conhecida como o Abominável Homem das Neves, está indo na contramão do que todos os seus semelhantes acreditam: ele tem a certeza que os seres humanos, para eles até então um mito, realmente existem, mesmo que todos da sua espécie neguem com veemência. Mas ele não irá desistir tão fácil de provar sua tese.","first_air_date":"2018-09-20","runtime":96,"episode_run_time":[96],"vote_average":6.8,"created_by":["Warner Bros. Pictures Animation","Zaftig Films","Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures Animation"},{"name":"Zaftig Films"},{"name":"Warner Bros. Pictures"}],"cast":["Channing Tatum","James Corden","Zendaya","Common","LeBron James"],"backdrop_path":"https://image.tmdb.org/t/p/original/zIVHIKljz7pFB8Es9U2n8xaUvDm.jpg","poster_path":"https://image.tmdb.org/t/p/original/sgONktl4877HWn1LcSCSF1p0UtA.jpg","certification":"L","genres":["Família","Animação","Aventura","Fantasia","Comédia"],"trailer":"tI2jd7z1HfQ"},
"83091":{"id":"83091","name":"Os Cavaleiros do Zodíaco: A Grande Batalha dos Deuses","slug":"os-cavaleiros-do-zodiaco-a-grande-batalha-dos-deuses","original_title":"聖闘士星矢 神々の熱き戦い","overview":"O filme começa com Hyoga salvando um soldado de Odin, mas este morre dizendo que a batalha dos deuses iria começar. O cavaleiro de cisne desaparece e, então, os outros Cavaleiros de Bronze vão para Asgard tentar descobrir o seu paradeiro, porém Saori Kido é sequestrada pelo representante de Odin, Durval. Assim começa uma batalha contra os Guerreiros de Asgard.","first_air_date":"1988-03-12","runtime":46,"episode_run_time":[46],"vote_average":7.6,"created_by":["Toei Animation"],"production_companies":[{"name":"Toei Animation"}],"cast":["古谷徹","鈴置洋孝","橋本晃一","Ryo Horikawa","堀秀行"],"backdrop_path":"https://image.tmdb.org/t/p/original/o1G9i9BzY598fE5RNmSWXCz24d4.jpg","poster_path":"https://image.tmdb.org/t/p/original/1RsREkIc1t0oJLbYlz0tE8uZTbG.jpg","certification":"N/A","genres":["Ação","Animação","Fantasia"],"trailer":"N/A"},
"537055":{"id":"537055","name":"Mulher-Maravilha: Linhagem de Sangue","slug":"mulher-maravilha-linhagem-de-sangue","original_title":"Wonder Woman: Bloodlines","overview":"Veja a origem lendária de um dos renomados membros da Liga da Justiça, Mulher Maravilha, conforme ela enfrenta o mal com sua espada e seu laço mágico. Determinada e igualmente forte no corpo e no coração, ela assume a missão de ajudar uma jovem garota problemática que foi recrutada por uma organização mortal conhecida como Corporação Vilania, cujos membros criminosos almejam invadir Themyscira, o lar paradisíaco de nossa heroína. A batalha será épica, porque se há uma coisa que as Amazonas conhecem bem, é a guerra!","first_air_date":"2019-10-04","runtime":83,"episode_run_time":[83],"vote_average":6.9,"created_by":["Warner Bros. Animation","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"}],"cast":["Rosario Dawson","Jeffrey Donovan","Marie Avgeropoulos","Kimberly Brooks","Ray Chase"],"backdrop_path":"https://image.tmdb.org/t/p/original/645T4C9rip5mvK2UrwTmLPIuKYd.jpg","poster_path":"https://image.tmdb.org/t/p/original/bjwO46qdVwq2WxoYT4qlKpuaGxX.jpg","certification":"10","genres":["Ficção científica","Animação"],"trailer":"N/A"},
