"66105":{"id":"66105","name":"Os Cavaleiros do Zodíaco: A Lenda dos Defensores de Atena","slug":"os-cavaleiros-do-zodiaco-a-lenda-dos-defensores-de-atena","original_title":"聖闘士星矢 真紅の少年伝説","overview":"Abel, irmão de Atena, tentou em um passado distante tornar-se o deus dos deuses. Sua ambição fez com que Zeus se unisse a Apolo para derrotá-lo. Após sua morte, Zeus ordenou que todos os registros sobre Abel fossem apagados, para que as futuras gerações jamais soubessem de sua existência. Porém, devido às blasfêmias cometidas pelos humanos, os deuses resolvem ressuscitar Abel, que tem por função punir a humanidade. Para ajudá-lo em sua missão Abel ressuscita três cavaleiros da era mitológica, que são protegidos por armaduras de bronze de Atena e reforçados como Armaduras do Sol, e ainda um grupo de Cavaleiros de Ouro. Abel, juntamente com seus guerreiros, leva Atena ao Santuário, o que a faz abandonar os Cavaleiros de Bronze. Liderados por Seiya, os Cavaleiros de Bronze partem em sua busca e tentam impedir que a humanidade atinja seu juízo final.","first_air_date":"1988-07-23","runtime":75,"episode_run_time":[75],"vote_average":7.7,"created_by":["Toei Animation"],"production_companies":[{"name":"Toei Animation"}],"cast":["古谷徹","鈴置洋孝","堀秀行","Ryo Horikawa","橋本晃一"],"backdrop_path":"https://image.tmdb.org/t/p/original/l4oOfCiMqIaaL0Vyx8dnu4FENra.jpg","poster_path":"https://image.tmdb.org/t/p/original/724kXHDFaSJw1WdYX2qi5XkYMLb.jpg","certification":"N/A","genres":["Ação","Animação","Fantasia"],"trailer":"N/A"},
