"169934":{"id":"169934","name":"Homem de Ferro: A Batalha Contra Ezekiel Stane","slug":"homem-de-ferro-a-batalha-contra-ezekiel-stane","original_title":"アイアンマン：ライズ・オブ・テクノヴォア","overview":"Com história de Brandon Auman (Os Vingadores: maiores heróis da Terra, Homem de Ferro: Armored Adventures), o filme explora um confronto entre o Homem de Ferro e o vilão Ezequiel Stane, que desenvolve uma nova bio-tecnologia que deixa a armadura do Homem de Ferro ultrapassada. Após Stane desencadear um ataque terrorista e focar na queda de Tony Stark, o Homem de Ferro deve ir em busca uma maneira de limpar seu nome.","first_air_date":"2013-04-24","runtime":88,"episode_run_time":[88],"vote_average":6.1,"created_by":["Sony Pictures","Madhouse"],"production_companies":[{"name":"Sony Pictures"},{"name":"Madhouse"}],"cast":["Tessyo Genda","Keiji Fujiwara","Miyu Irino","岡寛恵","Hiroki Yasumoto"],"backdrop_path":"https://image.tmdb.org/t/p/original/dC69G4jSq3TkgPIrfgRqZDOxlh4.jpg","poster_path":"https://image.tmdb.org/t/p/original/3vgn4p1gZ8RLk7ti4pYXVhiEfiE.jpg","certification":"N/A","genres":["Ficção científica","Animação","Ação"],"trailer":"N/A"},
