"212470":{"id":"212470","name":"Monster High: 13 Monster Desejos","slug":"monster-high-13-monster-desejos","original_title":"Monster High: 13 Wishes","overview":"É mais um ano escolar em Monster High e a irmãzinha de Clawdeen Wolf, Howleen, está decidida a ser mais fantástica que nunca. Seu sonho de popularidade acaba sendo mais fácil do que se imaginava, quando ela encontra uma gênia chamada Gigi Grant que lhe concede não 3, mas 13 desejos! Mas as monstrinhas logo aprendem a ter cuidado com o que desejam, porque cada desejo tem sem lado sinistro,e logo o corpo estudantil de Monster High vira de ponta-cabeça. Junte-se a Frankie Stein, Clawdeen Wolf, Draculaura e todas as incríveis amigas, que vão fundo com a lâmpada mágica para salvar a alma de Monster High... mostrando seu estilo fatal a cada passo do caminho.","first_air_date":"2013-10-08","runtime":73,"episode_run_time":[73],"vote_average":7.7,"created_by":["Nerd Corps Entertainment","Mattel"],"production_companies":[{"name":"Nerd Corps Entertainment"},{"name":"Mattel"}],"cast":["America Young","Jonquil Goode","Salli Saffioti","Kate Higgins","Debi Derryberry"],"backdrop_path":"https://image.tmdb.org/t/p/original/7cimOFA1OsuFPg3U3xLp8V194fL.jpg","poster_path":"https://image.tmdb.org/t/p/original/38Ww6Pn2hqpcaZcGo167W3tBPd4.jpg","certification":"N/A","genres":["Família","Fantasia","Animação"],"trailer":"N/A"},
