"18269":{"id":"18269","name":"A Dama e o Vagabundo II: As Aventuras de Banzé","slug":"a-dama-e-o-vagabundo-ii-as-aventuras-de-banze","original_title":"Lady and the Tramp II: Scamp's Adventure","overview":"Entre seus filhotes comportados, Dama e o Vagabundo criam o bagunceiro Banze – que está sempre aprontando alguma. Sonhando com a liberdade, Banzé sai de casa e conhece uma vira-lata adorável e teimosa chamada Angel. Ela o apresenta aos cães do lixo, liderados pelo escolado Buster que o desafia para o teste supremo da vida sem coleira. Agora, Banzé fica dividido entre um mundo repleto de aventuras e o amor pela família que abandonou.","first_air_date":"2001-02-18","runtime":69,"episode_run_time":[69],"vote_average":6.3,"created_by":["Disney Television Animation","Walt Disney Animation"],"production_companies":[{"name":"Disney Television Animation"},{"name":"Walt Disney Animation"}],"cast":["Scott Wolf","Alyssa Milano","Chazz Palminteri","Jeff Bennett","Jodi Benson"],"backdrop_path":"https://image.tmdb.org/t/p/original/rPIVGon9dNpgMvlGKqG2tvIG8vo.jpg","poster_path":"https://image.tmdb.org/t/p/original/r8kqvSoshJobn1zdZhJM0Gnj1kx.jpg","certification":"L","genres":["Família","Animação","Romance","Aventura"],"trailer":"N/A"},
"886396":{"id":"886396","name":"Batman e Superman: Batalha dos Super Filhos","slug":"batman-e-superman-batalha-dos-super-filhos","original_title":"Batman and Superman: Battle of the Super Sons","overview":"Jonathan Kent e o jovem companheiro relutante Damian Wayne estão encarregados de salvar o mundo da destruição iminente. Os dois devem unir forças para resgatar seus pais e salvar o planeta, tornando-se os super-heróis que deveriam ser.","first_air_date":"2022-10-17","runtime":79,"episode_run_time":[79],"vote_average":7.7,"created_by":["Warner Bros. Animation","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"}],"cast":["Jack Dylan Grazer","Jack Griffo","Laura Bailey","Troy Baker","Darin De Paul"],"backdrop_path":"https://image.tmdb.org/t/p/original/iQJ1gC2p6yn5wnBEklhPaEFJ3n1.jpg","poster_path":"https://image.tmdb.org/t/p/original/jkJjwFsZeQByufSkoY52SsmxdP0.jpg","certification":"N/A","genres":["Animação","Ação","Ficção científica"],"trailer":"N/A"},
"77459":{"id":"77459","name":"Um Monstro em Paris","slug":"um-monstro-em-paris","original_title":"Un monstre à Paris","overview":"Paris, 1910. Emile é apaixonado por filmes e trabalha como projecionista em uma sala de exibição. Ele está interessada em Maud, que também trabalha no cinema, mas tem medo de expressar seus sentimentos. Seu melhor amigo é Raoul, um criativo inventor que embarca com ele na caça a um misterioso monstro que está aterrorizando a cidade. Na jornada a dupla conta com a ajuda de Lucille, a estrela do cabaré LOiseau Rare.","first_air_date":"2011-10-12","runtime":90,"episode_run_time":[90],"vote_average":6.9,"created_by":["EuropaCorp","Bibo Films","France 3 Cinéma","Walking The Dog"],"production_companies":[{"name":"EuropaCorp"},{"name":"Bibo Films"},{"name":"France 3 Cinéma"},{"name":"Walking The Dog"}],"cast":["Vanessa Paradis","Matthieu Chedid","Gad Elmaleh","François Cluzet","Ludivine Sagnier"],"backdrop_path":"https://image.tmdb.org/t/p/original/hraZn64Gmyc8GUM5saZ6Ztnozay.jpg","poster_path":"https://image.tmdb.org/t/p/original/sK9nmpWH3YRamFTIdTHpAOXGrh2.jpg","certification":"L","genres":["Aventura","Animação","Comédia","Família","Fantasia"],"trailer":"N/A"},
"13398":{"id":"13398","name":"Padrinhos de Tóquio","slug":"padrinhos-de-toquio","original_title":"東京ゴッドファーザーズ","overview":"A terceira produção de Satoshi Kon, um dos mais interessantes diretores de anime da atualidade. Hana uma ex drag queen, Gin um antigo ciclista alcoólatra e Miyuki, uma adolescente fugitiva são três sem-teto que em sua tumultuada existência encontram um bebê abandonado no dia de natal. Os três resolvem então peregrinar em busca da solução do mistério e encontrar os pais da criança antes da chegada do ano novo. Durante a busca, deparam-se com fatos ocultos sobre o passado que são forçados à confrontar, ao mesmo tempo que aprendem a enfrentar o futuro juntos.","first_air_date":"2003-12-05","runtime":93,"episode_run_time":[93],"vote_average":7.9,"created_by":["Madhouse","Sony Pictures","dentsu","GENCO"],"production_companies":[{"name":"Madhouse"},{"name":"Sony Pictures"},{"name":"dentsu"},{"name":"GENCO"}],"cast":["岡本綾","梅垣義明","江守徹","こおろぎさとみ","能登麻美子"],"backdrop_path":"https://image.tmdb.org/t/p/original/e4S1jhTMXJRjhG1S8doUW81DH2i.jpg","poster_path":"https://image.tmdb.org/t/p/original/sRPSsS4GEcM4UIhAZiUffvEDoqH.jpg","certification":"N/A","genres":["Animação","Drama","Comédia"],"trailer":"N/A"},
