"149871":{"id":"149871","name":"O Conto da Princesa Kaguya","slug":"o-conto-da-princesa-kaguya","original_title":"かぐや姫の物語","overview":"Esta animação é baseada no conto popular japonês \"O Corte do Bambu\". Kaguya era um minúsculo bebê quando foi encontrada dentro de um tronco de bambu brilhante. Passado o tempo, ela se transforma em uma bela jovem que passa a ser cobiçada por cinco nobres, dentre eles, o próprio Imperador. Mas nenhum deles é o que ela realmente quer. A moça envia seus pretendentes em tarefas aparentemente impossíveis para tentar evitar o casamento com um estranho que não ama. Mas Kaguya terá que enfrentar seu destino e punição por suas escolhas.","first_air_date":"2013-11-23","runtime":137,"episode_run_time":[137],"vote_average":8.1,"created_by":["Studio Ghibli","Hakuhodo DY Media Partners","KDDI","Mitsubishi Shoji","Nippon Television Network Corporation","TOHO","T2 Studio"],"production_companies":[{"name":"Studio Ghibli"},{"name":"Hakuhodo DY Media Partners"},{"name":"KDDI"},{"name":"Mitsubishi Shoji"},{"name":"Nippon Television Network Corporation"},{"name":"TOHO"},{"name":"T2 Studio"}],"cast":["朝倉あき","地井武男","宮本信子","高良健吾","高畑淳子"],"backdrop_path":"https://image.tmdb.org/t/p/original/imUJOrtNf8EWameChpaRLXSaX4w.jpg","poster_path":"https://image.tmdb.org/t/p/original/2lcRVfHAuyLa4qT9uuIPC9sP9qE.jpg","certification":"N/A","genres":["Animação","Drama","Fantasia"],"trailer":"LBohvCiLZ34"},
