"12222":{"id":"12222","name":"Horton e o Mundo dos Quem!","slug":"horton-e-o-mundo-dos-quem","original_title":"Horton Hears a Who!","overview":"Horton (Jim Carrey) é um elefante que, um dia, ouve um pedido de socorro vindo de uma partícula de poeira que flutua no ar. Surpreso, ele passa a desconfiar que possa existir vida dentro daquela partícula. Trata-se dos Quem, seres que ignoram a existência de vida fora da cidade em que vivem, a Quemlândia. Mesmo com todos à sua volta acreditando que perdeu o juízo, Horton decide ajudar os moradores de Quemlândia.","first_air_date":"2008-03-03","runtime":86,"episode_run_time":[86],"vote_average":6.5,"created_by":["Blue Sky Studios","20th Century Fox Animation","Dr. Seuss Enterprises","20th Century Fox"],"production_companies":[{"name":"Blue Sky Studios"},{"name":"20th Century Fox Animation"},{"name":"Dr. Seuss Enterprises"},{"name":"20th Century Fox"}],"cast":["Jim Carrey","Steve Carell","Carol Burnett","Will Arnett","Seth Rogen"],"backdrop_path":"https://image.tmdb.org/t/p/original/Nfwmdxl2EDvVVE4An18Lio6tSx.jpg","poster_path":"https://image.tmdb.org/t/p/original/ccbrPygrecMP2QnGcC6taskeiNS.jpg","certification":"L","genres":["Animação","Comédia","Família","Aventura","Fantasia"],"trailer":"2Qw7jdr8EcM"},
"774741":{"id":"774741","name":"Diário de um Banana","slug":"diario-de-um-banana","original_title":"Diary of a Wimpy Kid","overview":"Greg Heffley é um garoto magricela, mas ambicioso, com uma imaginação ativa e grandes planos de ser rico e famoso, ele só precisa sobreviver ao ensino fundamental primeiro. Como detalhes de suas hilárias, e muitas vezes desastrosas tentativas de preencher as páginas de seu diário, Greg aprende a apreciar os verdadeiros amigos e a satisfação de defender o que é certo.","first_air_date":"2021-12-02","runtime":58,"episode_run_time":[58],"vote_average":6.2,"created_by":["Walt Disney Pictures","Bardel Entertainment"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Bardel Entertainment"}],"cast":["Brady Noon","Ethan William Childress","Hunter Dillon","Erica Cerra","Chris Diamantopoulos"],"backdrop_path":"https://image.tmdb.org/t/p/original/x78cvxbmpBNcHON7x3Iv8vih5Sj.jpg","poster_path":"https://image.tmdb.org/t/p/original/vPUoz6a3UfLhSAu6XLPQZXQODiI.jpg","certification":"10","genres":["Animação","Comédia","Família"],"trailer":"7EGLNl6BftQ"},
"46929":{"id":"46929","name":"Como é Bom se Divertir","slug":"como-e-bom-se-divertir","original_title":"Fun and Fancy Free","overview":"Jiminy Cricket apresenta dois curtas de animação da Disney: \"Bongo\", sobre um urso de circo que foge para a vida selvagem, e uma visão de famoso conto de fadas em \"Mickey e o Pé de Feijão\", com Mickey, Donald e Pateta nos papéis principais.","first_air_date":"1947-09-27","runtime":73,"episode_run_time":[73],"vote_average":6.3,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Edgar Bergen","Dinah Shore","Luana Patten","Walt Disney","Anita Gordon"],"backdrop_path":"https://image.tmdb.org/t/p/original/gcLCXH7ZTr3Yk2JG1u7cXb7p1vy.jpg","poster_path":"https://image.tmdb.org/t/p/original/tGOVtD7F6WYb0n3dR4PLauS6wj.jpg","certification":"N/A","genres":["Animação","Música"],"trailer":"N/A"},
