"647":{"id":"647","name":"Final Fantasy VII: Advent Children","slug":"final-fantasy-vii-advent-children","original_title":"Final Fantasy VII: Advent Children","overview":"Advent Children começa dois anos após o término do jogo que lhe deu origem. A Shinra Inc., uma poderosa empresa, está a acabar com o planeta devido às suas explorações. O lendário guerreiro da força de elite SOLDIER, Sephiroth, descobre provir de uma experiência genética, e decide acabar com a terra invocando um meteoro. Porém, Cloud, um ex-SOLDIER, e os seus companheiros impedem o apocalíptico meteoro, sepultando Sephiroth após várias batalhas.","first_air_date":"2005-07-14","runtime":101,"episode_run_time":[101],"vote_average":7.1,"created_by":["Square Enix","Visual Works"],"production_companies":[{"name":"Square Enix"},{"name":"Visual Works"}],"cast":["Takahiro Sakurai","伊藤歩","Showtaro Morikubo","Maaya Sakamoto","Keiji Fujiwara"],"backdrop_path":"https://image.tmdb.org/t/p/original/8xhgpYyNSX5sJi0P35hwL73QYOV.jpg","poster_path":"https://image.tmdb.org/t/p/original/bCiTioVufIGpIgC8OlG7boEzm9.jpg","certification":"12","genres":["Animação","Ação","Aventura","Fantasia","Ficção científica"],"trailer":"wut2am39z-c"},
