"13691":{"id":"13691","name":"Leitão: O Filme","slug":"leitao-o-filme","original_title":"Piglet's Big Movie","overview":"A história começa quando Leitão desaparece do Bosque dos Cem Acres, porque ouviu que era pequeno demais para ajudar Pooh, Tigrão, Ió, Guru e Coelho a procurar mais mel. Para encontrá-lo, seus amigos tentam achar no seu livro de anotações alguma pista de onde poderia ter ido. Enquanto procuram por Leitão, percebem que ele tinha feito coisas muito importantes durante as aventuras que participaram juntos. Então, quando Pooh se vê em dificuldades, surge o nosso pequeno herói que, com um pouco de sorte, consegue salvar o dia.","first_air_date":"2003-03-16","runtime":75,"episode_run_time":[75],"vote_average":6.7,"created_by":["Disney Television Animation","Walt Disney Pictures","DisneyToon Studios"],"production_companies":[{"name":"Disney Television Animation"},{"name":"Walt Disney Pictures"},{"name":"DisneyToon Studios"}],"cast":["John Fiedler","Jim Cummings","Nikita Hopkins","Ken Sansom","Peter Cullen"],"backdrop_path":"https://image.tmdb.org/t/p/original/yrIL6TukQ3m2KLf9oFoLMF7kDnz.jpg","poster_path":"https://image.tmdb.org/t/p/original/4gCiWiVgA6gYIP9he2fl0AJf4tW.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
