"16577":{"id":"16577","name":"Astro Boy","slug":"astro-boy","original_title":"Astro Boy","overview":"Metro City é uma metrópole reluzente, cuja localização fica no céu. É lá que o Dr. Tenma cria Astro Boy, na intenção de substituir o filho que perdeu. Astro Boy possui poderes extraordinários, sendo dotado com o que há de melhor nas características humanas. Após ser expulso, por não conseguir cumprir as expectativas geradas por Tenma, Astro Boy precisa aprender a conviver como um robô e aceitar o fato de não ser humano. Ele passa a ser perseguido pelas tropas do presidente Stone, que deseja tomar a fonte de energia que Astro Boy carrega dentro de si. Para escapar, ele cai na terra. Confuso e sem entender a nova realidade, ele resolve se passar por humano junto com um grupo de crianças de rua.","first_air_date":"2009-10-15","runtime":94,"episode_run_time":[94],"vote_average":6.3,"created_by":["Summit Entertainment","Imagi Animation Studios","Tezuka Productions"],"production_companies":[{"name":"Summit Entertainment"},{"name":"Imagi Animation Studios"},{"name":"Tezuka Productions"}],"cast":["Freddie Highmore","Kristen Bell","Nathan Lane","Eugene Levy","Matt Lucas"],"backdrop_path":"https://image.tmdb.org/t/p/original/t39jaNSYMVNecNPQSVVlW6I4opm.jpg","poster_path":"https://image.tmdb.org/t/p/original/jcM6F9Mivs4WZYE3N8MkLYx2ywP.jpg","certification":"L","genres":["Animação","Ação","Família","Ficção científica"],"trailer":"N/A"},
