"25961":{"id":"25961","name":"Pokémon: O Pesadelo de Darkrai","slug":"pokemon-o-pesadelo-de-darkrai","original_title":"劇場版ポケットモンスター ダイヤモンド&パール ディアルガVSパルキアVSダークライ","overview":"Ash acha que já viu de tudo quando se trata de Pokémon, mas estará ele pronto para enfrentar o misterioso Darkrai em sua última incrível aventura?A caminho do Torneio Pokémon, nossos heróis passam pela Cidade Alamos, lar das Torres Espaço-Tempo. Com a linda Alice, Ash e seus amigos descobrem que alguma coisa está causando terríveis pesadelos para os Pokémon e pessoas também! O Barão Alberto, um sujeito elegante, porém, arrogante, imediatamente responsabiliza Darkrai por estes eventos.Mas como se estivesse ouvindo a acusação, Darkrai aparece e confronta nossos heróis! Quem é Darkrai? É um amigo... ou inimigo? Enquanto o céu se despedaça sobre a Cidade Alamos e os Pokémon Lendários Dialga e Palkia batalham em uma dimensão recém-criada, tal batalha ameaça abrir um rombo no contínuo do espaço-tempo! Poderá Ash e seus amigos sobreviverem a este confronto e descobrir a verdadeira natureza de Darkrai?","first_air_date":"2007-07-14","runtime":90,"episode_run_time":[90],"vote_average":6.9,"created_by":["Pikachu Project","TV Tokyo","The Pokémon Company","Shogakukan","Media Factory","TakaraTomy","jeki","OLM","Shogakukan Production"],"production_companies":[{"name":"Pikachu Project"},{"name":"TV Tokyo"},{"name":"The Pokémon Company"},{"name":"Shogakukan"},{"name":"Media Factory"},{"name":"TakaraTomy"},{"name":"jeki"},{"name":"OLM"},{"name":"Shogakukan Production"}],"cast":["松本梨香","Ikue Otani","うえだゆうじ","豊口めぐみ","Megumi Hayashibara"],"backdrop_path":"https://image.tmdb.org/t/p/original/dGulOAB9N4qJlafWxI4YczXDA4I.jpg","poster_path":"https://image.tmdb.org/t/p/original/A1Js7nkmCP8lWuyDYY0zFqeskqd.jpg","certification":"N/A","genres":["Família","Aventura","Animação","Fantasia","Ação","Ficção científica"],"trailer":"N/A"},
