"41498":{"id":"41498","name":"One Piece: Strong World","slug":"one-piece-strong-world","original_title":"ワンピース フィルム ストロングワールド","overview":"O East Blue está em crise? A notícia atinge os Chapéus de Palha ao longo de sua jornada. Com suas cidades natais enfrentando momentos difíceis, Luffy e seus amigos colocam suas aventuras em espera e decidem voltar para o East Blue, quando de repente um misterioso navio pirata aparece voando no céu. O homem que dirigi o navio não é outro senão o usuário de Akuma no Mi, Shiki “O Leão Dourado”, o mesmo lendário pirata que conseguiu escapar da grande prisão submarina Impel Down, e ficou entre os mais infames piratas como o “Rei dos piratas” Gol D. Roger e Barba Branca. Depois de seqüestrar Nami por suas habilidades de navegação intuitivas, Shiki envia Luffy e sua tripulação hurdling para baixo a suas próprias ilhas flutuantes pessoais. Separando, a tripulação encontram-se então colocados em uma batalha de sobrevivência com feras terríveis em ambientes misteriosos.","first_air_date":"2009-12-12","runtime":113,"episode_run_time":[113],"vote_average":7.5,"created_by":["Toei Animation","Shueisha"],"production_companies":[{"name":"Toei Animation"},{"name":"Shueisha"}],"cast":["Mayumi Tanaka","Kazuya Nakai","Akemi Okamura","Kappei Yamaguchi","Hiroaki Hirata"],"backdrop_path":"https://image.tmdb.org/t/p/original/1oaRUHv1zX4mZNX1zq4NcHIg50m.jpg","poster_path":"https://image.tmdb.org/t/p/original/s5UuGv4LxDNkfVm3dG6GEIyGNFE.jpg","certification":"N/A","genres":["Animação","Fantasia","Aventura"],"trailer":"N/A"},
