"9904":{"id":"9904","name":"Selvagem","slug":"selvagem","original_title":"The Wild","overview":"O leão Sansão (Kiefer Sutherland) é a grande atração do zoológico de Nova York. Ele adora contar histórias de arrepiar sobre sua juventude na selva ao seu filho Ryan (Greg Cipes) e aos demais animais do zoológico. Cansado de viver à sombra do pai e sem conseguir dar um rugido realmente forte, Ryan decide fugir do zoológico rumo à vida selvagem. Ele logo é capturado para ser enviado à África, o que faz com que Sansão e outros animais iniciem uma expedição para resgatá-lo.","first_air_date":"2006-04-06","runtime":82,"episode_run_time":[82],"vote_average":5.5,"created_by":["Walt Disney Pictures","C.O.R.E. Feature Animation","Contrafilm","Hoytyboy Pictures","Nigel Productions","Sir Zip Studios"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"C.O.R.E. Feature Animation"},{"name":"Contrafilm"},{"name":"Hoytyboy Pictures"},{"name":"Nigel Productions"},{"name":"Sir Zip Studios"}],"cast":["Kiefer Sutherland","Jim Belushi","Eddie Izzard","Janeane Garofalo","William Shatner"],"backdrop_path":"https://image.tmdb.org/t/p/original/gSxkr5zSki8OLTpMQAxJyPXygQH.jpg","poster_path":"https://image.tmdb.org/t/p/original/tDnDREbW2eNjd9KvjVKtnNf5A5Y.jpg","certification":"N/A","genres":["Família","Animação"],"trailer":"N/A"},
"34134":{"id":"34134","name":"Barbie: Vida de Sereia","slug":"barbie-vida-de-sereia","original_title":"Barbie in A Mermaid Tale","overview":"Barbie é Merliah, uma campeã de surf de Malibu. Em um momento ela é uma adolescente, e no outro descobre um chocante segredo de família: ela é uma sereia! Merliah e seu amigo golfinho, Zuma, partem para uma aventura no fundo do mar para resgatar sua mãe, a rainha de Oceana. Com ajuda das suas amigas sereias, Merliah salva o reino do mar. No final ela descobre que o que faz de você ser diferente, pode ser sua maior virtude.","first_air_date":"2010-01-25","runtime":75,"episode_run_time":[75],"vote_average":7.2,"created_by":["Rainmaker Entertainment","Mattel"],"production_companies":[{"name":"Rainmaker Entertainment"},{"name":"Mattel"}],"cast":["Kelly Sheridan","Kathleen Barr","Tabitha St. Germain","Peter Mel","Nakia Burrise"],"backdrop_path":"https://image.tmdb.org/t/p/original/lFNADy1elNHpUxML41Mi7JRstey.jpg","poster_path":"https://image.tmdb.org/t/p/original/rrD263RRyDPXqDY7FBtNP7gEuQZ.jpg","certification":"N/A","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
"13459":{"id":"13459","name":"Barbie em a Canção de Natal","slug":"barbie-em-a-cancao-de-natal","original_title":"Barbie in 'A Christmas Carol'","overview":"No filme, Barbie é Eden Starling, uma glamurosa cantora de um teatro londrino. Acompanhada de seu gato Chuzzlewit, a personagem planeja fazer com que todos os artistas do local permaneçam e ensaiem para o tão esperado Dia de Natal. Observando tal atitude, Catherine, amiga de infância da diva, conversa sobre o seu mal-humor. Até que, em um momento mágico, três espíritos do Natal levam Eden a uma fantástica viagem que abrirá seu coração para o verdadeiro sentido do Natal.","first_air_date":"2008-11-03","runtime":86,"episode_run_time":[86],"vote_average":7.1,"created_by":["Mattel","Rainmaker Entertainment"],"production_companies":[{"name":"Mattel"},{"name":"Rainmaker Entertainment"}],"cast":["Kelly Sheridan","Morwenna Banks","Melissa Lyons","Prudence Edwards","Leanne Araya"],"backdrop_path":"https://image.tmdb.org/t/p/original/vYjZEw6g76pDXSoXTwtypr42Iyz.jpg","poster_path":"https://image.tmdb.org/t/p/original/4h4ayaBjFIMD3cO2lmyuRd9FFD7.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
