"12180":{"id":"12180","name":"Star Wars: A Guerra dos Clones","slug":"star-wars-a-guerra-dos-clones","original_title":"Star Wars: The Clone Wars","overview":"A animação \"Star Wars - The Clone Wars\" dá continuidade à epopéia espacial criada por George Lucas nos anos 1970. A galáxia é consumida pelas Guerras Clônicas, uma massiva guerra civil que entrincheirou os malvados Separatistas e seus exércitos andróides contra a República e seus protetores, os Jedis. Para ganhar uma vantagem no crescente conflito, o Cavaleiro Jedi Anakin Skywalker e sua aprendiz Padawan Ahsoka Tano são enviados em uma missão com vastas consequências, uma que os coloca face a face com o notório lorde do crime Jabba, o Hutt. Adicionando mais ameaças que aguardam os dois em Tatooine, Anakin e Ahsoka são perseguidos por Conde Dookan e seus sinistros asseclas - incluindo a misteriosa Asajj Ventress -, que não vão parar até que os Jedis tenham sido derrotados. Enquanto isso, na frente de batalha, Obi-Wan Kenobi e Mestre Yoda lideram as forças clônicas em um esforço para resistir às forças do Lado Negro...","first_air_date":"2008-08-05","runtime":98,"episode_run_time":[98],"vote_average":6.1,"created_by":["Lucasfilm Ltd.","Lucasfilm Animation","Warner Bros. Pictures"],"production_companies":[{"name":"Lucasfilm Ltd."},{"name":"Lucasfilm Animation"},{"name":"Warner Bros. Pictures"}],"cast":["Matt Lanter","Ashley Eckstein","James Arnold Taylor","David Acord","Dee Bradley Baker"],"backdrop_path":"https://image.tmdb.org/t/p/original/eVA4ztLIuPEsokkgQ3NRt9rTRVh.jpg","poster_path":"https://image.tmdb.org/t/p/original/nCZYnCkoDSfm00FOJ5qYnzkB82p.jpg","certification":"10","genres":["Animação","Ação","Ficção científica","Aventura"],"trailer":"N/A"},
"10991":{"id":"10991","name":"Pokémon 3: O Feitiço dos Unown","slug":"pokemon-3-o-feitico-dos-unown","original_title":"劇場版ポケットモンスター 結晶塔の帝王 ENTEI","overview":"O jovem treinador pokémon Ash Ketchum e seus amigos partem rumo à bela montanha de Greenfield, onde eles devem encontrar Unown, o mais misterioso de todos os pokémon. O motivo da busca é que Unown criou uma disputa mais instigante que qualquer outra batalha pokémon que Ash já tenha enfrentado. Mas, com a ajuda de Pikachu, seus amigos Misty e Brock e até mesmo da Equipe Rocket, Ash irá ainda ajudar a órfã Molly a se libertar das forças místicas que a mantém presa em um mundo de sonhos.","first_air_date":"2000-07-08","runtime":74,"episode_run_time":[74],"vote_average":6.5,"created_by":["Nintendo","OLM","TV Tokyo","Pikachu Project 2000","Shogakukan","Media Factory","Tomy","Creatures","GAME FREAK","jeki","Shogakukan Production"],"production_companies":[{"name":"Nintendo"},{"name":"OLM"},{"name":"TV Tokyo"},{"name":"Pikachu Project 2000"},{"name":"Shogakukan"},{"name":"Media Factory"},{"name":"Tomy"},{"name":"Creatures"},{"name":"GAME FREAK"},{"name":"jeki"},{"name":"Shogakukan Production"}],"cast":["松本梨香","Ikue Otani","うえだゆうじ","飯塚雅弓","Megumi Hayashibara"],"backdrop_path":"https://image.tmdb.org/t/p/original/dLGQo5Xq6H18vPx00Czot8VHi3K.jpg","poster_path":"https://image.tmdb.org/t/p/original/vqUWAVNetRIIQC6I0UDnubz8Qw3.jpg","certification":"N/A","genres":["Aventura","Fantasia","Animação","Ação","Família"],"trailer":"N/A"},
"15137":{"id":"15137","name":"Evangelion: 1.0 Você (Não) Está Sozinho","slug":"evangelion-1-0-voce-nao-esta-sozinho","original_title":"ヱヴァンゲリヲン新劇場版：序","overview":"Tokyo-3 permanece em pé após a maior parte da civilização ter sido dizimada no Segundo Impacto. Agora, a cidade sofre o ataque incessante dos estranhos e mortais Anjos, criaturas bizarras empenhadas em exterminar a raça humana. Para combater esse cruel inimigo, a agência governamental NERV constrói uma frota de máquinas humanóides (os EVAs) e Shinji Ikari é chamado para entrar em ação! Vivendo uma vida de solidão e questionando sua própria existência, Shinji se esforça para aceitar a responsabilidade para a batalha pela sobrevivência da humanidade.","first_air_date":"2007-09-01","runtime":98,"episode_run_time":[98],"vote_average":7.6,"created_by":["khara"],"production_companies":[{"name":"khara"}],"cast":["緒方恵美","Megumi Hayashibara","三石琴乃","Yuriko Yamaguchi","Akira Ishida"],"backdrop_path":"https://image.tmdb.org/t/p/original/ktzhr2m6y98PtwOdfOtTA0X232m.jpg","poster_path":"https://image.tmdb.org/t/p/original/xzYLUve9n4Q3oSntwunNfU1D2s1.jpg","certification":"12","genres":["Animação","Ficção científica","Ação","Drama"],"trailer":"N/A"},
"79218":{"id":"79218","name":"A Era do Gelo: Especial de Natal","slug":"a-era-do-gelo-especial-de-natal","original_title":"Ice Age: A Mammoth Christmas","overview":"Quando Sid acidentalmente destrói uma peça que está na família de Manny há anos e acaba indo para na lista dos ‘não bonzinhos’ que o Papai Noel não vai presentear, ele parte numa hilária viagem até o Polo Norte para tentar consertar as coisas… e como sempre, acaba piorando tudo! A única esperança agora é Manny reunir seu bando pré-histórico e salvar o Natal para o mundo todo!","first_air_date":"2011-11-24","runtime":26,"episode_run_time":[26],"vote_average":6.5,"created_by":["20th Century Fox Animation","Blue Sky Studios","Reel FX Creative Studios"],"production_companies":[{"name":"20th Century Fox Animation"},{"name":"Blue Sky Studios"},{"name":"Reel FX Creative Studios"}],"cast":["Billy Gardell","Ray Romano","John Leguizamo","Queen Latifah","Denis Leary"],"backdrop_path":"https://image.tmdb.org/t/p/original/fHGrJK08XuVlfiCaUkWYOn3L7QA.jpg","poster_path":"https://image.tmdb.org/t/p/original/tNJDdFZozVL4JWc7pYbAsnbeF4K.jpg","certification":"L","genres":["Animação","Família","Cinema TV"],"trailer":"N/A"},
