"14444":{"id":"14444","name":"Rugrats: Os Anjinhos - O Filme","slug":"rugrats-os-anjinhos-o-filme","original_title":"The Rugrats Movie","overview":"Tommy ganha um irmão, o pequeno Dil, que logo passa a receber todos os afagos e atenção de seus pais e de seus amigos. Enciumado com a nova situação, Tommy, motivado pelos conselhos de Angélica, decide devolver Dil para o lugar de onde veio: o hospital. Os amigos de Tommy descobrem o plano e resolvem fazer de tudo para impedir que Dil vá embora. Porém, eles terminam indo para bem longe de seus pais e se perdendo em plena floresta, onde precisarão enfrentar seus próprios medos para conseguir retornar a seus lares.","first_air_date":"1998-11-20","runtime":79,"episode_run_time":[79],"vote_average":6.2,"created_by":["Klasky-Csupo","Nickelodeon Movies","Paramount Pictures"],"production_companies":[{"name":"Klasky-Csupo"},{"name":"Nickelodeon Movies"},{"name":"Paramount Pictures"}],"cast":["Whoopi Goldberg","David Spade","E. G. Daily","Tara Strong","Christine Cavanaugh"],"backdrop_path":"https://image.tmdb.org/t/p/original/cC9oBBqGcOdBheKre24YfthsptI.jpg","poster_path":"https://image.tmdb.org/t/p/original/4ESY5mlf3bD1mf4RSRu4HTc6QLo.jpg","certification":"L","genres":["Família","Animação","Comédia","Aventura"],"trailer":"N/A"},
